import React, { useEffect, useState } from "react";
import axios from "axios";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';

export default function Ambulance() {
    const [ambulance, setAmbulances] = useState([]);
    const [no_plate, setNoPlate] = useState("");
    const [driver, setDriver] = useState("");
    const [oxygen, setOxygen] = useState("");
    const [dri_num, setDriNum] = useState("");
    const [oxi, setOxi] = useState("");

    useEffect(() => {
        axios.get("http://localhost:8080/ambulance/all")
            .then(response => setAmbulances(response.data))
            .catch(error => console.error("Error fetching users:", error));
    }, []);

    const ambulanceQuery = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.get(`http://localhost:8080/ambulance/get/${no_plate}`);
            console.log("Ambulance found:", response.data);
            setDriNum(response.data.driver_contact);
            setOxi(response.data.oxygen_status);
        } catch (error) {
            console.error("Error fetching ambulance:", error);
        }
    }
    return (
        <div>
            <div>
                <br />
                <br />
                <br />
                <br />
                <h2>Ambulances List</h2>
                <h2>Here they are</h2>
            </div>
            <ul>
                <br />
                <br />
                {ambulance.map(user => (
                    <li key={user.ambulance_num_plate}>
                        Number Plate: {user.ambulance_num_plate}
                        <br />
                        Driver contact no: {user.driver_contact}
                        <br />
                        Oxygen ase naki? ({user.oxygen_status})
                    </li>
                ))}
            </ul>

            <div>
                <h2>Search for ambulance</h2>
                    <Box
                               component="form"
                               sx={{ '& > :not(style)': { m: 1, width: '25ch' } }}
                               noValidate
                               autoComplete="off"
                            >
                               <TextField
                               id="outlined-basic"
                               label="No plate"
                               variant="outlined"
                               onChange={(e) => setNoPlate(e.target.value)}
                               />
                               <Stack direction="row" spacing={2}>
                                     <Button onClick={ambulanceQuery}>Search</Button>
                               </Stack>
                            </Box>
                            {qambulance &&
                            <div>
                                <h2>Found Ambulance</h2>
                                <p>Driver contact: {dri_num}</p>
                                <p>Oxygen status: {oxi}</p>
                            </div>
                            }
                    </div>
        </div>
    );
}
